import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Address = () => {
  const [address, setAddress] = useState({
    street: '',
    city: '',
    state: '',
    zip_code: '',
    country: ''
  });
  const [isEditing, setIsEditing] = useState(false);
  const [error, setError] = useState('');

  // Fetch address on page load
  useEffect(() => {
    const fetchAddress = async () => {
      try {
        const response = await axios.get('http://localhost:8000/medical_store_app/address/');
        setAddress(response.data);
      } catch (err) {
        setError('Error fetching address.');
      }
    };

    fetchAddress();
  }, []);

  // Handle form input changes
  const handleChange = (e) => {
    setAddress({
      ...address,
      [e.target.name]: e.target.value
    });
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.put('http://localhost:8000/medical_store_app/address/update/', address);
      setAddress(response.data);
      setIsEditing(false); // Stop editing
    } catch (err) {
      setError('Error updating address.');
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Address</h2>
      {error && <div style={styles.error}>{error}</div>}

      {isEditing ? (
        <form onSubmit={handleSubmit}>
          <label style={styles.label}>Street</label>
          <input
            style={styles.input}
            type="text"
            name="street"
            value={address.street}
            onChange={handleChange}
          />

          <label style={styles.label}>City</label>
          <input
            style={styles.input}
            type="text"
            name="city"
            value={address.city}
            onChange={handleChange}
          />

          <label style={styles.label}>State</label>
          <input
            style={styles.input}
            type="text"
            name="state"
            value={address.state}
            onChange={handleChange}
          />

          <label style={styles.label}>Zip Code</label>
          <input
            style={styles.input}
            type="text"
            name="zip_code"
            value={address.zip_code}
            onChange={handleChange}
          />

          <label style={styles.label}>Country</label>
          <input
            style={styles.input}
            type="text"
            name="country"
            value={address.country}
            onChange={handleChange}
          />

          <button type="submit" style={styles.button}>Update Address</button>
        </form>
      ) : (
        <div>
          <p><strong>Street:</strong> {address.street}</p>
          <p><strong>City:</strong> {address.city}</p>
          <p><strong>State:</strong> {address.state}</p>
          <p><strong>Zip Code:</strong> {address.zip_code}</p>
          <p><strong>Country:</strong> {address.country}</p>

          <button onClick={() => setIsEditing(true)} style={styles.button}>Edit Address</button>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    padding: '20px',
    marginTop: '50px',
    fontFamily: 'Arial, sans-serif',
    width: '100%',
    maxWidth: '500px',
    margin: '0 auto',
    borderRadius: '10px',
    boxShadow: '0px 4px 6px rgba(0, 0, 0, 0.1)',
  },
  heading: {
    fontSize: '24px',
    marginBottom: '20px',
  },
  label: {
    marginBottom: '10px',
    fontSize: '16px',
    fontWeight: 'bold',
  },
  input: {
    marginBottom: '20px',
    padding: '10px',
    fontSize: '16px',
    borderRadius: '5px',
    border: '1px solid #ddd',
    width: '100%',
  },
  button: {
    padding: '10px 20px',
    fontSize: '16px',
    backgroundColor: '#4CAF50',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  error: {
    color: 'red',
    fontSize: '14px',
    marginTop: '10px',
  },
};

export default Address;
